import { Ionicons} from '@expo/vector-icons';
import { Pressable } from 'react-native'

export default function IconButton({onPress, color, icon}) {
    return <Pressable>
        <Ionicons onPress={onPress} name={icon}size={24} color="white" />
    </Pressable>
}
